import React, { useEffect, useState } from "react";
import { useLocation, useParams } from "react-router-dom";
import io from "socket.io-client";
import PlayerList from "./PlayerList";
import WordDisplay from "./WordDisplay";
import Chat from "./ChatBox";

const SERVER_URL = process.env.REACT_APP_SERVER_URL || "http://localhost:5000";

let socket;

export default function GameRoom() {
  const { roomId } = useParams();
  const location = useLocation();
  const [playerId, setPlayerId] = useState(location.state?.playerId || null);
  const [playerName] = useState(location.state?.playerName || "Guest");
  const [gameState, setGameState] = useState(null);
  const [letter, setLetter] = useState("");
  const [wordGuess, setWordGuess] = useState("");

  useEffect(() => {
    socket = io(SERVER_URL);

    socket.emit("join-room", { roomId, playerId, playerName }, ({ success }) => {
      if (!success) alert("Failed to join room");
    });

    socket.on("joined-room", ({ playerId }) => {
      setPlayerId(playerId);
    });

    socket.on("game-state", setGameState);
    socket.on("round-started", setGameState);
    socket.on("game-started", setGameState);
    socket.on("player-joined", setGameState);
    socket.on("player-left", setGameState);

    return () => {
      socket.disconnect();
    };
  }, [roomId, playerId, playerName]);

  const sendLetter = () => {
    if (!letter) return;
    socket.emit("guess-letter", { roomId, playerId, letter });
    setLetter("");
  };

  const sendWord = () => {
    if (!wordGuess) return;
    socket.emit("guess-word", { roomId, playerId, guess: wordGuess });
    setWordGuess("");
  };

  const startGame = () => {
    socket.emit("start-game", { roomId, playerId });
  };

  const setWord = () => {
    if (!wordGuess) return;
    socket.emit("set-word", { roomId, playerId, word: wordGuess });
    setWordGuess("");
  };

  if (!gameState) return <p>Loading room...</p>;

  const isHost = gameState.players.find((p) => p.id === playerId)?.isHost;
  const isWordSetter =
    gameState.wordSetterId === playerId && gameState.roundInProgress === false;

  return (
    <div>
      <h2>Room: {roomId}</h2>
      <PlayerList players={gameState.players} currentPlayerId={playerId} />
      <WordDisplay revealed={gameState.secretWordRevealed} />
      <p>Global Strikes: {gameState.globalStrikes}/{gameState.maxStrikes}</p>
      {isHost && !gameState.gameStarted && (
        <button onClick={startGame}>Start Game</button>
      )}
      {isWordSetter && (
        <>
          <input
            type="text"
            placeholder="Set secret word"
            value={wordGuess}
            onChange={(e) => setWordGuess(e.target.value)}
          />
          <button onClick={setWord}>Set Word</button>
        </>
      )}
      {gameState.roundInProgress && gameState.currentTurnPlayerId === playerId && (
        <>
          <input
            type="text"
            maxLength={1}
            placeholder="Guess letter"
            value={letter}
            onChange={(e) => setLetter(e.target.value)}
          />
          <button onClick={sendLetter}>Guess Letter</button>
          <input
            type="text"
            placeholder="Guess full word"
            value={wordGuess}
            onChange={(e) => setWordGuess(e.target.value)}
          />
          <button onClick={sendWord}>Guess Word</button>
        </>
      )}
      <Chat socket={socket} playerId={playerId} messages={gameState.messages} />
    </div>
  );
}
